import React from 'react';
import {makeStyles} from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const useStyles = makeStyles({
    table: {
        minWidth: 650,
    },
});

function createData(name, calories, fat, carbs, protein) {
    return {name, calories, fat, carbs, protein};
}

const rows = [
    createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
    createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
    createData('Eclair', 262, 16.0, 24, 6.0),
    createData('Cupcake', 305, 3.7, 67, 4.3),
    createData('Gingerbread', 356, 16.0, 49, 3.9),
];
export default class BasicTable extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            headers: [],
            tableData: []
        };
    }

    // componentWillReceiveProps(nextProps) {
    //     let stateToUpdate = {}
    //     if (nextProps) {
    //         if (nextProps.headers) {
    //             stateToUpdate.headers = nextProps.headers || []
    //         }
    //         if (nextProps.tableData) {
    //             stateToUpdate.tableData = nextProps.tableData || []
    //         }
    //         this.setState(stateToUpdate);
    //     }
    // }

    createTableComponent() {
        const classes = useStyles();

        let tableComponent = '<Table className={classes.table} aria-label="simple table">'
        const headers = this.state.headers || [];
        const tableData = this.state.tableData || [];
        tableComponent += '<TableHead><TableRow>';
        for (const header of headers) {
            tableComponent += typeof header === "string" ? '<TableCell>{header}</TableCell>' : '<TableCell> </TableCell>';
        }
        tableComponent += '</TableRow></TableHead>';

        tableComponent += '<TableBody>';
        for (const data of tableData) {
            tableComponent += '<TableRow>';
            for (const key in data) {
                tableComponent += '<TableCell>{data[key}</TableCell>';
            }
            tableComponent += '</TableRow>';
        }
        tableComponent += '</TableBody></Table>';

        return tableComponent;
    }



        render() {
        const tableComponent = this.createTableComponent();

        return (
            <TableContainer component={Paper}>
                {tableComponent}
            </TableContainer>
        );
    }
}
